function useCountUp(target, duration = 1800, start = false) {
  const [value, setValue] = useState(0);
  useEffect(() => {
    if (!start) { setValue(0); return; }
    let startTime = null;
    const step = (timestamp) => {
      if (!startTime) startTime = timestamp;
      const progress = Math.min((timestamp - startTime) / duration, 1);
      const eased = 1 - Math.pow(1 - progress, 3);
      setValue(Math.round(eased * target));
      if (progress < 1) requestAnimationFrame(step);
    };
    requestAnimationFrame(step);
  }, [target, duration, start]);
  return value;
}

function ParticleField({ active }) {
  const canvasRef = useRef(null);
  useEffect(() => {
    const canvas = canvasRef.current;
    if (!canvas) return;
    const ctx = canvas.getContext("2d");
    let animId;
    let particles = [];
    const resize = () => {
      canvas.width = canvas.offsetWidth;
      canvas.height = canvas.offsetHeight;
      particles = Array.from({ length: 60 }, () => ({
        x: Math.random() * canvas.width,
        y: Math.random() * canvas.height,
        vx: (Math.random() - 0.5) * 0.4,
        vy: (Math.random() - 0.5) * 0.4,
        r: Math.random() * 2 + 0.5,
        opacity: Math.random() * 0.4 + 0.1,
      }));
    };
    resize();
    window.addEventListener("resize", resize);
    const draw = () => {
      ctx.clearRect(0, 0, canvas.width, canvas.height);
      particles.forEach((p, i) => {
        p.x += p.vx;
        p.y += p.vy;
        if (p.x < 0) p.x = canvas.width;
        if (p.x > canvas.width) p.x = 0;
        if (p.y < 0) p.y = canvas.height;
        if (p.y > canvas.height) p.y = 0;
        ctx.beginPath();
        ctx.arc(p.x, p.y, p.r, 0, Math.PI * 2);
        ctx.fillStyle = `rgba(100,180,255,${p.opacity})`;
        ctx.fill();
        particles.slice(i + 1).forEach((p2) => {
          const dx = p.x - p2.x, dy = p.y - p2.y;
          const dist = Math.sqrt(dx * dx + dy * dy);
          if (dist < 120) {
            ctx.beginPath();
            ctx.moveTo(p.x, p.y);
            ctx.lineTo(p2.x, p2.y);
            ctx.strokeStyle = `rgba(100,180,255,${0.08 * (1 - dist / 120)})`;
            ctx.lineWidth = 0.8;
            ctx.stroke();
          }
        });
      });
      animId = requestAnimationFrame(draw);
    };
    draw();
    return () => { cancelAnimationFrame(animId); window.removeEventListener("resize", resize); };
  }, [active]);
  return <canvas ref={canvasRef} style={{ position: "absolute", inset: 0, width: "100%", height: "100%", opacity: active ? 1 : 0, transition: "opacity 1s" }} />;
}

function SlideWrapper({ active, children, id }) {
  return (
    <div style={{
      position: "absolute", inset: 0,
      opacity: active ? 1 : 0,
      transform: active ? "translateY(0)" : "translateY(24px)",
      transition: "opacity 0.6s cubic-bezier(.4,0,.2,1), transform 0.6s cubic-bezier(.4,0,.2,1)",
      pointerEvents: active ? "auto" : "none",
      display: "flex", flexDirection: "column", justifyContent: "center",
      padding: "40px 60px",
      boxSizing: "border-box",
    }}>
      {children}
    </div>
  );
}

function Tag({ children, color = "#64b4ff" }) {
  return (
    <span style={{
      display: "inline-block", fontSize: "11px", fontFamily: "'Courier New', monospace",
      textTransform: "uppercase", letterSpacing: "2.5px", color,
      borderLeft: `2px solid ${color}`, paddingLeft: "12px", marginBottom: "20px",
    }}>{children}</span>
  );
}

function BigHeading({ children, style = {} }) {
  return <h1 style={{
    fontFamily: "'Georgia', serif", fontSize: "clamp(32px, 5vw, 56px)",
    fontWeight: 300, color: "#fff", lineHeight: 1.15, margin: 0, letterSpacing: "-1px", ...style
  }}>{children}</h1>;
}

function Sub({ children, style = {} }) {
  return <p style={{
    fontFamily: "'Segoe UI', sans-serif", fontSize: "15px", color: "#7a8fa3",
    lineHeight: 1.7, maxWidth: 560, margin: "18px 0 0", ...style
  }}>{children}</p>;
}

