//  MAIN APP 
export default function CogniqwavePitch() {
  const [current, setCurrent] = useState(0);
  const containerRef = useRef(null);

  const goTo = useCallback((idx) => {
    if (idx >= 0 && idx < SLIDES.length) setCurrent(idx);
  }, []);

  useEffect(() => {
    const handler = (e) => {
      if (e.key === "ArrowRight" || e.key === "ArrowDown") goTo(current + 1);
      if (e.key === "ArrowLeft" || e.key === "ArrowUp") goTo(current - 1);
    };
    window.addEventListener("keydown", handler);
    return () => window.removeEventListener("keydown", handler);
  }, [current, goTo]);

  // Touch/swipe
  const touchStart = useRef(null);
  const onTouchStart = (e) => { touchStart.current = e.touches[0].clientX; };
  const onTouchEnd = (e) => {
    if (touchStart.current === null) return;
    const diff = touchStart.current - e.changedTouches[0].clientX;
    if (Math.abs(diff) > 50) goTo(current + (diff > 0 ? 1 : -1));
    touchStart.current = null;
  };

  const slideComponents = [
    <HeroSlide active={current === 0} />,
    <ProblemSlide active={current === 1} />,
    <SolutionSlide active={current === 2} />,
    <ProductSlide active={current === 3} />,
    <MarketSlide active={current === 4} />,
    <TractionSlide active={current === 5} />,
    <ModelSlide active={current === 6} />,
    <CompetitionSlide active={current === 7} />,
    <AskSlide active={current === 8} />,
  ];

  return (
    <>
      <style>{`
        @keyframes fadeUp { from { opacity:0; transform:translateY(20px); } to { opacity:1; transform:translateY(0); } }
        @keyframes slideIn { from { opacity:0; transform:translateX(30px); } to { opacity:1; transform:translateX(0); } }
        @keyframes growUp { from { transform:scaleY(0); } to { transform:scaleY(1); } }
        * { box-sizing: border-box; margin: 0; padding: 0; }
        body { background: #0a0f1a; }
        ::-webkit-scrollbar { width: 0; }
        button:focus { outline: none; }
      `}</style>
      <div
        ref={containerRef}
        onTouchStart={onTouchStart}
        onTouchEnd={onTouchEnd}
        style={{
          background: "#0a0f1a",
          minHeight: "100vh",
          position: "relative",
          overflow: "hidden",
          fontFamily: "'Segoe UI', sans-serif",
          color: "#fff",
        }}
      >
        {/* Ambient background */}
        <div style={{ position: "fixed", inset: 0, pointerEvents: "none", zIndex: 0 }}>
          <div style={{ position: "absolute", top: "-20%", left: "-10%", width: "60%", height: "60%", background: "radial-gradient(ellipse, rgba(100,180,255,0.06) 0%, transparent 70%)", filter: "blur(40px)" }} />
          <div style={{ position: "absolute", bottom: "-10%", right: "-5%", width: "50%", height: "50%", background: "radial-gradient(ellipse, rgba(167,139,250,0.05) 0%, transparent 70%)", filter: "blur(40px)" }} />
        </div>

        {/* Top nav bar */}
        <div style={{ position: "fixed", top: 0, left: 0, right: 0, zIndex: 100, padding: "18px 32px", display: "flex", justifyContent: "space-between", alignItems: "center", background: "linear-gradient(180deg, rgba(10,15,26,0.9) 0%, transparent 100%)" }}>
          <div style={{ display: "flex", alignItems: "center", gap: "8px" }}>
            <img src={LOGO} alt="Cogniqwave" style={{ width: "28px", height: "28px", objectFit: "contain" }} />
            <span style={{ fontFamily: "'Georgia', serif", fontSize: "14px", color: "#fff", letterSpacing: "1.5px" }}>COGNIQWAVE</span>
          </div>
          <div style={{ fontSize: "12px", color: "#5a6a7a", fontFamily: "'Courier New', monospace" }}>{current + 1} / {SLIDES.length}</div>
        </div>

        {/* Slides container */}
        <div style={{ position: "relative", minHeight: "100vh", width: "100%" }}>
          {slideComponents}
        </div>

        {/* Bottom nav */}
        <div style={{
          position: "fixed", bottom: "28px", left: "50%", transform: "translateX(-50%)", zIndex: 100,
          display: "flex", alignItems: "center", gap: "6px",
          background: "rgba(10,15,26,0.85)", backdropFilter: "blur(16px)",
          border: "1px solid rgba(255,255,255,0.08)", borderRadius: "40px", padding: "8px 8px",
        }}>
          {SLIDES.map((s, i) => (
            <button
              key={i}
              onClick={() => goTo(i)}
              style={{
                background: i === current ? "linear-gradient(135deg,#64b4ff,#a78bfa)" : "transparent",
                border: "none", borderRadius: "20px",
                padding: i === current ? "7px 16px" : "7px 8px",
                color: i === current ? "#fff" : "#5a6a7a",
                fontSize: "11px", fontFamily: "'Segoe UI', sans-serif", cursor: "pointer",
                transition: "all 0.3s cubic-bezier(.4,0,.2,1)",
                whiteSpace: "nowrap",
                display: "flex", alignItems: "center",
              }}
            >
              {i === current ? s.label : <div style={{ width: "6px", height: "6px", borderRadius: "50%", background: "#5a6a7a" }} />}
            </button>
          ))}
        </div>

        {/* Arrow hints */}
        <button onClick={() => goTo(current - 1)} style={{
          position: "fixed", left: "12px", top: "50%", transform: "translateY(-50%)", zIndex: 100,
          background: "rgba(10,15,26,0.6)", border: "1px solid rgba(255,255,255,0.08)", borderRadius: "50%",
          width: "36px", height: "36px", display: "flex", alignItems: "center", justifyContent: "center",
          cursor: current === 0 ? "default" : "pointer", opacity: current === 0 ? 0.15 : 0.5, transition: "opacity 0.2s",
          color: "#fff", fontSize: "16px",
        }}></button>
        <button onClick={() => goTo(current + 1)} style={{
          position: "fixed", right: "12px", top: "50%", transform: "translateY(-50%)", zIndex: 100,
          background: "rgba(10,15,26,0.6)", border: "1px solid rgba(255,255,255,0.08)", borderRadius: "50%",
          width: "36px", height: "36px", display: "flex", alignItems: "center", justifyContent: "center",
          cursor: current === SLIDES.length - 1 ? "default" : "pointer", opacity: current === SLIDES.length - 1 ? 0.15 : 0.5, transition: "opacity 0.2s",
          color: "#fff", fontSize: "16px",
        }}></button>
      </div>
    </>
  );
}
